type Props = {
  isDark: boolean;
};

const ContactPage = ({ isDark }: Props) => {
  // use the isDark prop here
  return (
    <div>
      <h1>Contact Us</h1>
      <p>Please feel free to contact us at:</p>
      <ul>
        <li>Email: info@example.com</li>
        <li>Phone: 555-1234</li>
      </ul>
      <p>The isDark prop value is: {isDark ? 'true' : 'false'}</p>
    </div>
  );
};

export default ContactPage;
